import './App.css';
import LoginFotm from './LoginForm.js'

class App extends Component {
  render() {
    return (
      <div className="App">
      <div>
      <LoginForm/>
      </div>
        <header className="App-header">
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }
}

export default Login;
